const styles = {
    appBackground: {
        //backgroundColor linear gradient
        background: "linear-gradient(18deg, rgba(30, 33, 36, 1) 50vh, " +
            "rgba(30, 33, 36, 1) 50vw, rgba(30, 33, 36, 1) 73.14vh, #0051C2 94.94vw)",
        //fills whole app screen
        height: "100vh",
        //no margin
        margin: 0,
        //no padding
        padding: 0,
        //no overflow
        overflow: "hidden",
    },
}

export default styles;
